INSERT INTO `wpfs_posts` VALUES (37, 1, '2018-08-14 02:54:03', '2018-08-14 02:54:03', '<h3><strong>Why Calandria Enterprise ?</strong></h3>\r\n<img class=\"size-medium wp-image-30 alignleft\" src=\"http://calandria-enterprise.com/wp-content/uploads/2018/08/DSC0002812-300x200.jpg\" alt=\"\" width=\"300\" height=\"200\" />\r\n<ul>\r\n 	<li>Our weddings and events are characterised by timeless and elegant designs, where the execution is flawless from first impressions to the smallest details. Our goal is to get it right every single time! We approach each wedding and event with meticulous attention to detail during the design, styling and planning stages.</li>\r\n 	<li>Besides orchestrating flawless wedding and events, our goal is to ensure our clients enjoy the planning experience just as much. Making sure our clients are happy and their dreams come true is what we do. And we like to think, do well.</li>\r\n 	<li>At The Calandria Enterprise, we spend time getting to know you, our clients. We like to discover your visions, dreams and style. No matter your vision, we will work closely with you to create something truly unique as a couple. We offer a fully customised service and tailor our services to suit your requirements. Services include: Full Planning and Design, Partial Planning and Design and Wedding or Event Management.</li>\r\n 	<li>Calandria Enterprise, Wedding Planner and Event Organizer, has a passion for perfection to ensure each wedding and event is enchanting and unique. We pride ourselves on maintaining honest and excellent communication, whilst building strong relationships with both couples and industry professionals.</li>\r\n</ul>', 'Why Us', '', 'inherit', 'closed', 'closed', '', '36-revision-v1', '', '', '2018-08-14 02:54:03', '2018-08-14 02:54:03', '', 36, 'http://calandria-enterprise.com/2018/08/14/36-revision-v1/', 0, 'revision', '', 0);
