INSERT INTO `wpfs_posts` VALUES (79, 1, '2019-01-01 03:17:27', '2019-01-01 03:17:27', 'Every one have a big wedding dream, let\'s discuss with us how to plan it, prepare your wedding check list with our wedding consultant. We have the nice package on a strick budget. We\'ll help you (bride &amp; groom to be) find out the way make your wedding dream comes true. Start from find the great vendor, plan the ceremonial wedding, manage your time to prepare your wedding checklist, manage a schedule to technical meeting with vendors and venue management. Include: Engagement, Prewedding, Akad, Reception, and Honeymoon.\r\n\r\n<strong>Dimana wedding planner All in Package </strong><em>(All in adalah paket jasa pernikahan lengkap, yang di dapatkan mulai dari perencanaan pernikahan, perhitungan budget, pemilihan vendor, persiapan akad, hari h resepsi, dan calon pengantin juga berkesempatan mendapatkan pilihan BONUS berupa: Honeymoon, Wedding Ring, Prawedding Photo, dll. </em><em>*Bonus disesuaikan dengan ketersediaan dari Pihak WO. </em>\r\n\r\n<em>Â </em><em>All in package ini terbagi menjadi 3 pilihan paket. Yang membuat berbeda adalah jumlah undangannya)</em>\r\n<ol>\r\n 	<li><strong>a) Silver </strong><em>(Untuk undangan berjumlah 300 org/ 600 pax)</em></li>\r\n 	<li><strong>b) Gold </strong><em>(Untuk undangan berjumlah 400 org/ 800 pax)</em></li>\r\n 	<li><strong>c) Platinum </strong><em>(Untuk undangan berjumlah 500 org/ 1000 pax)</em></li>\r\n</ol>\r\n&nbsp;', 'Wedding Planner', '', 'inherit', 'closed', 'closed', '', '66-revision-v1', '', '', '2019-01-01 03:17:27', '2019-01-01 03:17:27', '', 66, 'http://calandria-enterprise.com/2019/01/01/66-revision-v1/', 0, 'revision', '', 0);
INSERT INTO `wpfs_posts` VALUES (80, 1, '2019-01-01 03:18:36', '2019-01-01 03:18:36', '<ol>\r\n 	<li>Weâll manage wedding preparation on the day. We have a job desk to coordinate of wedding ceremonial as coordinator, liaison organizer of bride &amp; groom, protocoler VIP, time keeper, checker, stopper, and protocoler MC.</li>\r\n</ol>\r\n&nbsp;\r\n\r\nDimana wedding organizer yang kami ber nama <strong>Full Day Coordination </strong><em>(Full Day Coordination/ One Day Service adalah paket jasa pernikahan yang memberikan pelayanan pada hari H, Full Day CoordinationÂ  ini terbagi menjadi 3 pilihan paket. Yang membuat berbeda adalah jumlah undangan, dan tentunya jumlah team WO menyesuaikan dengan jumlah undangan)</em>\r\n<ol>\r\n 	<li><strong>a) Silver </strong><em>(Untuk undangan berjumlah 300 org/ 600 pax : Team WO 5 org)</em></li>\r\n 	<li><strong>b) Gold </strong><em>(Untuk undangan berjumlah 400 org/ 800 pax : Team WO 7 org)</em></li>\r\n 	<li><strong>c) Platinum </strong><em>(Untuk undangan berjumlah 500 org/ 1000 pax : Team WO 9 org)</em></li>\r\n</ol>\r\n&nbsp;\r\n\r\natau wedding organizer by request If you just need partial project, like: photo, video, make up, master of ceremony, etc\r\n\r\n<em>By Request ini apa yang didapatkan, dan berapa jumlah biaya yang dibutuhkan disesuaikan dengan permintaan dari klien/ calon pengantin) </em>', 'Wedding Organizer', '', 'inherit', 'closed', 'closed', '', '69-revision-v1', '', '', '2019-01-01 03:18:36', '2019-01-01 03:18:36', '', 69, 'http://calandria-enterprise.com/2019/01/01/69-revision-v1/', 0, 'revision', '', 0);
