e_font=\"Quattrocento|700|||||||\" title_level=\"h3\" title_font_size=\"20px\" closed_toggle_text_color=\"#000000\" custom_margin=\"-5px|||||\"]<p>Besides orchestrating flawless wedding and events, our goal is to ensure our clients enjoy the planning experience just as much. Making sure our clients are happy and their dreams come true is what we do. And we like to think, do well.</p>[/et_pb_toggle][et_pb_toggle title=\"Fully Customised Service\" _builder_version=\"3.29.2\" hover_enabled=\"0\" text_orientation=\"justified\" title_font=\"Quattrocento|700|||||||\" title_level=\"h3\" title_font_size=\"20px\" closed_toggle_text_color=\"#000000\" custom_margin=\"-22px|||||\"]<p>At The Calandria Enterprise, we spend time getting to know you, our clients. We like to discover your visions, dreams and style. No matter your vision, we will work closely with you to create something truly unique as a couple. We offer a fully customised service and tailor our services to suit your requirements. Services include: Full Planning and Design, Partial Planning and Design and Wedding or Event Management.</p>\n[/et_pb_toggle][et_pb_toggle title=\"Ensure Each Wedding and EventÂ \" _builder_version=\"3.29.2\" hover_enabled=\"0\" text_orientation=\"justified\" title_font=\"Quattrocento|700|||||||\" title_level=\"h3\" title_font_size=\"20px\" closed_toggle_text_color=\"#000000\" custom_margin=\"-22px|||||\"]<p>Calandria Enterprise, Wedding Planner and Event Organizer, has a passion for perfection to ensure each wedding and event is enchanting and unique. We pride ourselves on maintaining honest and excellent communication, whilst building strong relationships with both couples and industry professionals.</p>[/et_pb_toggle][/et_pb_column][/et_pb_row][/et_pb_section][et_pb_section fb_built=\"1\" admin_label=\"Feature Section\" _builder_version=\"3.22\" custom_padding=\"120px||120px|\" fb_built=\"1\" _i=\"2\" _address=\"2\" min_height=\"920px\"][et_pb_row _builder_version=\"3.25\" _i=\"0\" _add