"rgba(255,255,255,0)\" background_color_gradient_direction=\"150deg\" background_color_gradient_start_position=\"30%\" background_color_gradient_overlays_image=\"on\" background_image=\"http://calandria-enterprise.com/wp-content/uploads/2019/09/about-us-2.jpg\" custom_padding=\"195px||12%|||\" hover_enabled=\"0\" fb_built=\"1\" _i=\"1\" _address=\"1\" min_height=\"673px\"][et_pb_row column_structure=\"1_2,1_2\" _builder_version=\"3.25\" _i=\"0\" _address=\"1.0\"][et_pb_column type=\"1_2\" _builder_version=\"3.25\" custom_padding=\"|||\" _i=\"0\" _address=\"1.0.0\" custom_padding__hover=\"|||\"][et_pb_text admin_label=\"Title\" _builder_version=\"3.27.4\" text_font=\"||||||||\" header_font=\"||||||||\" header_line_height=\"1.2em\" header_2_font=\"Quattrocento||||||||\" header_2_font_size=\"60px\" header_2_line_height=\"1.3em\" custom_margin=\"||10px|\" animation_style=\"slide\" animation_direction=\"top\" animation_intensity_slide=\"5%\" header_2_font_size_tablet=\"40px\" header_2_font_size_last_edited=\"on|desktop\" locked=\"off\" _i=\"0\" _address=\"1.0.0.0\"]<h2>Why you must choose Calandria Enterprise?</h2>[/et_pb_text][/et_pb_column][et_pb_column type=\"1_2\" _builder_version=\"3.25\" custom_padding=\"|||\" _i=\"1\" _address=\"1.0.1\" custom_padding__hover=\"|||\"][et_pb_toggle title=\"Timeless & Elegant Design\" _builder_version=\"3.29.2\" hover_enabled=\"0\" text_orientation=\"justified\" title_font=\"Quattrocento|700|||||||\" title_level=\"h3\" title_font_size=\"20px\" closed_toggle_text_color=\"#000000\" custom_margin=\"||11px|||\"]<p>Our weddings and events are characterised by timeless and elegant designs, where the execution is flawless from first impressions to the smallest details. Our goal is to get it right every single time! We approach each wedding and event with meticulous attention to detail during the design, styling and planning stages.</p>\n[/et_pb_toggle][et_pb_toggle title=\"Enjoy The Planning Experience\" _builder_version=\"3.29.2\" hover_enabled=\"0\" text_orientation=\"justified\" title_font=\"Quattrocento|700|||||||\" title_level=\"h3\" title_font_size=\"20px\" closed_toggle_text_color=\"#000000\" custom_margin=\"-5px|||||\"]<p>Besides orchestrating flawless wedding and events, our goal is to ensure our clients enjoy the planning experience just as much. Making sure our clients are happy and their dreams come true is what we do. And we like to think, do well.</p>[/et_pb_toggle][et_pb_toggle title=\"Fully Customised Service\" _builder_version=\"3.29.2\" hover_enabled=\"0\" text_orientation=\"justified\" title_font=\"Quattrocento|700|||||||\" title_level=\"h3\" title_font_size=\"20px\" closed_toggle_text_color=\"#000000\" custom_margin=\"-22px|||||\"]<p>At The Calandria Enterprise, we spend time getting to know you, our clients. We like to discover your visions, dreams and style. No matter your vision, we will work closely with you to create something truly unique as a couple. We offer a fully customised service and tailor our services to suit your requirements. Services include: Full Planning and Design, Partial Planning and Design and Wedding or Event Management.</p>\n[/et_pb_toggle][et_pb_toggle title=\"Ensure Each Wedding and EventÂ \" _builder_version=\"3.29.2\" hover_enabled=\"0\" text_orientation=\"justified\" title_font=\"Quattrocento|700|||||||\" title_level=\"h3\" title_font_size=\"20px\" closed_toggle_text_color=\"#000000\" custom_margin=\"-22px|||||\"]<p>Calandria Enterprise, Wedding Planner and Event Organizer, has a passion for perfection to ensure each wedding and event is enchanting and unique. We pride ourselves on maintaining honest and excellent communication, whilst building strong relationships with both couples and industry professionals.</p>[/et_pb_toggle][/et_pb_column][/et_pb_row][/et_pb_section][et_pb_section fb_built=\"1\" admin_label=\"Feature Section\" _builder_version=\"3.29.2\" custom_padding=\"120px||120px|\" hover_enabled=\"0\" fb_built=\"1\" _i=\"2\" _address=\"2\" mi